  false,\n\t\"url\": null,\n\t\"notes\": \"The Campus Parks Program addresses the
  shortage of parkland in Chicago's neighborhoods by targeting public school grounds
  for parkland improvements. Under a joint program funded by the City, Chicago Public
  Schools and the Chicago Park District, existing asphalt and concrete paving are
  replaced with new landscaping, play equipment, trees, fencing and lighting.rnrnPriority
  is given to neighborhoods identified as having insufficient parkland, Strategic
  Neighborhood Action Program districts, Empowerment Zones, Enterprise Communities
  and other special development districts.rnTo view or use these files, compression
  software and special GIS software, such as ESRI ArcGIS, is required.rnTo download,
  right-click the \"Download\" link above and choose \"Save link as.\"\",\n\t\"license_title\":
